#undef YYKEYTYPE
#undef YYPEEK
#undef YYSKIP
#undef YYBACKUPCTX
#undef YYRESTORECTX
#undef YYLESSTHAN
#undef YYFILL

#define YYCTYPE unsigned char
#define YYKEYTYPE unsigned char
#define YYPEEK() *cursor
#define YYSKIP() ++cursor
#define YYLESSTHAN(n) (limit - cursor) < n
#define YYFILL(n) { break; }

static int action_line318
    ( unsigned int i
    , const YYKEYTYPE * keys
    , const YYCTYPE * start
    , const YYCTYPE * token
    , const YYCTYPE ** cursor
    , YYKEYTYPE rule_act
    )
{
    const long pos = token - start;
    const long len_act = *cursor - token;
    const long len_exp = (long) keys [3 * i + 1];
    const YYKEYTYPE rule_exp = keys [3 * i + 2];
    if (rule_exp == 255)
    {
        fprintf
            ( stderr
            , "warning: lex_line318: control flow is undefined for input"
                " at position %ld, rerun re2c with '-W'\n"
            , pos
            );
    }
    if (len_act == len_exp && rule_act == rule_exp)
    {
        const YYKEYTYPE offset = keys[3 * i];
        *cursor = token + offset;
        return 0;
    }
    else
    {
        fprintf
            ( stderr
            , "error: lex_line318: at position %ld (iteration %u):\n"
                "\texpected: match length %ld, rule %u\n"
                "\tactual:   match length %ld, rule %u\n"
            , pos
            , i
            , len_exp
            , rule_exp
            , len_act
            , rule_act
            );
        return 1;
    }
}

int lex_line318 ()
{
    const size_t padding = 2; /* YYMAXFILL */
    int status = 0;
    size_t input_len = 0;
    size_t keys_count = 0;
    YYCTYPE * input = NULL;
    YYKEYTYPE * keys = NULL;
    const YYCTYPE * cursor = NULL;
    const YYCTYPE * limit = NULL;
    const YYCTYPE * token = NULL;
    const YYCTYPE * eof = NULL;
    unsigned int i = 0;

    input = (YYCTYPE *) read_file
        ("rexx.S.c.line318.input"
        , sizeof (YYCTYPE)
        , padding
        , &input_len
        );
    if (input == NULL)
    {
        status = 1;
        goto end;
    }

    keys = (YYKEYTYPE *) read_file
        ("rexx.S.c.line318.keys"
        , 3 * sizeof (YYKEYTYPE)
        , 0
        , &keys_count
        );
    if (keys == NULL)
    {
        status = 1;
        goto end;
    }

    cursor = input;
    limit = input + input_len + padding;
    eof = input + input_len;

    for (i = 0; status == 0 && i < keys_count; ++i)
    {
        token = cursor;
        YYCTYPE yych;

        if (YYLESSTHAN (2)) YYFILL(2);
        yych = YYPEEK ();
        switch (yych) {
        case 0x00:    goto yy445;
        case '\n':    goto yy442;
        case '*':    goto yy440;
        case '/':    goto yy444;
        default:    goto yy447;
        }
yy440:
        YYSKIP ();
        switch ((yych = YYPEEK ())) {
        case '/':    goto yy450;
        default:    goto yy441;
        }
yy441:
        status = action_line318 (i, keys, input, token, &cursor, 4);
        continue;
yy442:
        YYSKIP ();
        status = action_line318 (i, keys, input, token, &cursor, 1);
        continue;
yy444:
        YYSKIP ();
        yych = YYPEEK ();
        switch (yych) {
        case '*':    goto yy448;
        default:    goto yy441;
        }
yy445:
        YYSKIP ();
        status = action_line318 (i, keys, input, token, &cursor, 3);
        continue;
yy447:
        YYSKIP ();
        yych = YYPEEK ();
        goto yy441;
yy448:
        YYSKIP ();
        status = action_line318 (i, keys, input, token, &cursor, 2);
        continue;
yy450:
        YYSKIP ();
        status = action_line318 (i, keys, input, token, &cursor, 0);
        continue;

    }
    if (status == 0)
    {
        if (cursor != eof)
        {
            status = 1;
            const long pos = token - input;
            fprintf (stderr, "error: lex_line318: unused input strings left at position %ld\n", pos);
        }
        if (i != keys_count)
        {
            status = 1;
            fprintf (stderr, "error: lex_line318: unused keys left after %u iterations\n", i);
        }
    }

end:
    free (input);
    free (keys);

    return status;
}

#undef YYCTYPE
#undef YYKEYTYPE
#undef YYPEEK
#undef YYSKIP
#undef YYLESSTHAN
#undef YYFILL

int main ()
{
    if (lex_line265 () != 0) return 1;
    if (lex_line290 () != 0) return 1;
    if (lex_line318 () != 0) return 1;
    return 0;
}
